Hoy 2 de Septiembre fue esterilizada Chocolatta. Gracias a nuestros veterinarios de la clínica El Rancho ubicada en Barrio Obrero por las jornadas que nos ofrecen 💪🏼❤️.
Choco es una cachorra rescatada hace aprox. 15 días en la autopista, a la altura de la panadería El Viajero. Tiene aprox. 7 meses. Se encuentra en un hogar de paso con una señora mayor que la adora pero se le hace difícil quedarse con ella porque le cuesta dominarla y su vez mantenerla 😢.
Un agradecimiento especial a la Sra. Diana por apoyar con el traslado desde Santa Eduviges a la clínica y al Sr. Wilmer por ayudar con el retorno, Dios les Bendiga 🙏🏻.
Ella es una perrita Noble, Juguetona, Cariñosa, tamaño mediano y apenas se recupere, estará lista para encontrar una familia que realmente la ame y la considere un miembro más 😍🙏🏻❤️.
Si deseas brindar una segunda oportunidad comunícate con nuestra amiga Carmen al: 04247068836.
#FundacionLabrador #FundacionLabradorRetriever #SanCristobal #Tachira #Venezuela #Difunde #ProteccionAnimal #Voluntario #Perro #Perrito #Gracias #MuchasGracias
Today, September 2nd, Chocolatta was sterilized. Thanks to our veterinarians at the El Rancho clinic in Barrio Obrero for the surgeries they offer us.
Choco is a puppy rescued 15 days ago on the highway, near the El Viajero bakery. She is 7 months old, and she is in temporary home with a lady, but she can’t adopt her because it would be very difficult for her. A special thanks to Mrs. Diana for supporting the mobilization from Santa Eduviges to the clinic, and to Mr. Wilmer for helping with the return.
Chocolatta is a docile and playful dog, she is medium size, and as soon as she recovers, she will be ready to find a family that really loves her.
If you want to give her a second chance, you can contact our friend Carmen at: 04247068836.
